import { Component } from "react";
import Layout from "@components/Layout";

export default class Category extends Component {
  static async getInitialProps({ pathname }) {
    return { pathname };
  }

  render() {
    return <Layout path={this.props.pathname}>11111</Layout>;
  }
}
